Calling song . The call of this species consists of simple, repetitive, short phrases (
Figure 5
). Each phrase comprises 4–5 syllables (each syllable being 2 milli-seconds (ms) duration, two pulses, all statistics n = 1 recording) that lasts for 10 ms duration. The syllables are each separated by a brief period of silence ranging from 13 to 22 ms duration. Another period of silence occurs at the end of each phrase and lasts between 300 and 1300 ms duration.

The single recording indicates a highest amplitude frequency plateau between 14 and> 24 kHz, and a dominant frequency of 21 kHz (
Figure 5
). Notably, this frequency is slightly beyond the limits of the recording equipment used to capture the song, so the true dominant frequency and upper limit of the frequency plateau may be higher than indicated here. Some minor components of the song extend down to 12 kHz and below.
